{
  "$schema": "https://biomejs.dev/schemas/1.8.3/schema.json",
  "extends": [
    "@taskylizard/biome-config",
    "./.cache/imports.json"
  ],
  "files": {
    "ignore": [
      "docs/.vitepress/**/*.vue",
      "docs/.vitepress/vue-shim.d.ts",
      ".cache/imports.d.ts"
    ]
  },
  "formatter": {
    "enabled": false
  },
  "css": {
    "linter": {
      "enabled": false
    },
    "formatter": {
      "enabled": false
    }
  },
  "json": {
    "formatter": {
      "enabled": false
    },
    "linter": {
      "enabled": false
    }
  },
  "vcs": {
    "enabled": true,
    "clientKind": "git"
  },
  "javascript": {
    "globals": [
      "defineNitroConfig",
      "eventHandler",
      "useRuntimeConfig",
      "readValidatedBody",
      "defineEventHandler"
    ]
  },
  "linter": {
    "rules": {
      "correctness": {
        "noUndeclaredVariables": "off"
      },
      "style": {
        "useFilenamingConvention": "off",
        "noDefaultExport": "off"
      }
    }
  }
}

{
  inputs = {
    nixpkgs.url = "github:nixos/nixpkgs/nixpkgs-unstable";
  };
  outputs = {nixpkgs, ...}: let
    forAllSystems = f:
      nixpkgs.lib.genAttrs nixpkgs.lib.systems.flakeExposed (system: let
        pkgs = nixpkgs.legacyPackages.${system};
      in
        f pkgs);
  in {
    packages = forAllSystems (pkgs: {
      formatter = pkgs.alejandra;
    });

    devShells = forAllSystems (pkgs: {
      default = pkgs.mkShell {
        packages = with pkgs; [
          nodejs
          pnpm
          git
        ];
      };
    });
  };
}

